import './styles.css';
import logo from '../../assets/image/nuKenzie.svg';
import aside from '../../assets/image/home_aside.svg';

const Home = () => {

  return (
    <div>

      <main className='container'>
        <aside className='start'>
          <img src={logo} alt="logo" />
          <h1 className='main__title'>Centralize o controle das suas finanças</h1>
          <p className=''>de forma rápida e segura</p>
          <button className='btn__start'>Iniciar</button>

        </aside>
        <aside>
          <img src={aside} alt="aside__right"/>
        </aside>
      </main>

    </div>
  )
}

export default Home;
